import React from 'react';

import 'RentBike.css';

import { mockRentBike } from '../../mockRentBike/mockRentBike'

const RentBike = () => {

    const element = mockRentBike.map(({ id, ...items }) => {
        return (
            <RentBikeItem 
                key={id}
                items={items}/>
        )
    })

    return (
        <div className="rentBike">
            <h3 className="title font-weight-bold">Your rent (Total: $12.99)</h3>
            <div className="list-group listRentBike">
                {element}
            </div>
        </div>
    );
};

export default RentBike;
